import { useState } from 'react';
import { Storage } from 'aws-amplify';


function LoadList(){
	const [setFiles] = useState([]);
	Storage.list('',{
        level: '',
      }).then(files => { // file name filter, if listing all files without prefix, pass '' instead
        setFiles(files);
      }).catch(err => { 
        console.log(err);
      });
}
export default LoadList;
